'  l_lf constant varchar2(1) := chr(10);    '||chr(10)||
'begin'||chr(10)||
'  apex_plugin_util.debug_process( p_plugin, p_process );'||chr(10)||
'--'||chr(10)||
'  for i in 1 .. 2'||chr(10)||
